import React from 'react';
import {
  Card, CardContent, CardMedia, Typography, Button, Box, Grid
} from '@mui/material';

function HomePage() {
  return (
    <Box sx={{
      minHeight: '100vh',
      bgcolor: '#fff',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      py: 8
    }}>
      <Typography
        variant="h3"
        sx={{
          fontWeight: 700,
          color: "#212121",
          mb: 5,
          letterSpacing: 1,
          fontFamily: "'Montserrat', Arial, sans-serif",
          textAlign: "center"
        }}
      >
        Fastest Fuel Delivery
      </Typography>
      <Card sx={{
        maxWidth: 400,
        borderRadius: 6,
        boxShadow: 6,
        overflow: "hidden"
      }}>
        <CardMedia
          component="img"
          height="180"
          image="https://images.unsplash.com/photo-1519125323398-675f0ddb6308?auto=format&fit=crop&w=800&q=80"
          alt="Fuel Delivery"
        />
        <CardContent>
          <Typography
            variant="h5"
            component="div"
            sx={{
              color: "#e23744",
              fontWeight: 700,
              mb: 1,
              fontFamily: "'Montserrat', Arial, sans-serif",
            }}
          >
            Order Fuel Instantly
          </Typography>
          <Typography
            variant="body1"
            sx={{
              color: "#666",
              mb: 3,
              fontSize: 16
            }}
          >
            Get fuel delivered anywhere in your city, pay online and track your orders!
          </Typography>
        </CardContent>
        <Box sx={{ px: 3, pb: 3 }}>
          <Button
            fullWidth
            variant="contained"
            sx={{
              bgcolor: "#e23744",
              color: "#fff",
              borderRadius: 99,
              py: 1.2,
              fontWeight: 700,
              fontFamily: "'Montserrat', Arial, sans-serif",
              fontSize: "1.05rem",
              boxShadow: 2,
              '&:hover': { bgcolor: "#b81a34" }
            }}
          >
            ORDER NOW
          </Button>
        </Box>
      </Card>
    </Box>
  );
}
export default HomePage;
